import React from "react";

function TodoLists({ todos, deleteTodo }) {
  return (
    <ul>
      {todos.map((todo) => (
        <li key={todo.id} id={todo.id}>
          {todo["todo"]}
          <button
            onClick={(e) => {
              deleteTodo(e);
            }}
          >
            x
          </button>
        </li>
      ))}
    </ul>
  );
}

export default TodoLists;
